    const[redditPostData, setRedditPostData] = useState([{}]);

    useEffect(() => {
        fetch(`${url}`).then(
            res => res.json()
        ).then(
            data => {
                setRedditPostData(data)
                console.log(data)
            }
        )
    },[]);

    return (
        <div>
            <h1>{(typeof redditPostData.results === 'undefined') ? (
                <div>
                    <p>Data is loading....</p>
                </div>
            ): (
                <div>
                <p>Data loaded successfully</p>
            </div>
            )
            }</h1>
        </div>
    )
}

